  return (
    <div>
      <Link to={`/profile/income/${_id}`}>
        <h3>{title}</h3>
      </Link>
      <p>{description} </p>
      <p>{income}</p>
      <p>{category}</p>
    </div>
  );
}

export default IncomeCard;
